  const [posts, setPosts] = useState([
    {id: 1, title: 'Javascript', body: 'JavaScript - язык программирования'},
    {id: 2, title: 'Javascript 2', body: 'JavaScript - язык программирования'}
  ])

  return (
    <div className="App">
      {posts.map(post => 
        <PostItem post={post} key={post.id}/>
      )}
    </div>
  );
}

export default App;
